-- ================================================================
-- VERIFY IMPORT
-- ================================================================
SELECT 
    s.name as store,
    c.name as carrier,
    COUNT(*) as total_cities,
    COUNT(*) FILTER (WHERE cc.rate IS NOT NULL) as with_coverage,
    COUNT(*) FILTER (WHERE cc.rate IS NULL) as sin_cobertura
FROM carrier_coverage cc
JOIN carriers c ON c.id = cc.carrier_id
JOIN stores s ON s.id = cc.store_id
GROUP BY s.name, c.name
ORDER BY s.name, c.name;